import React, { Component } from 'react';
import { Dialog } from "@blueprintjs/core";
import '../App.css';

const material_type = (bool, context) => {
  return (
    <Dialog
      isOpen={bool}
      onClose={() => {context.setState({dialogs:{material_type:false}})}}
      canOutsideClickClose={true}>
      Hello World!
    </Dialog>
  )
}

export {material_type}
